import {useEffect, useState} from "react";
import {Link, Route, useNavigate} from "react-router-dom";


const Dashboard = () => {
    const navigate = useNavigate();
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [productos, setProductos] = useState([]);


    useEffect(() => {
        fetch("http://localhost:3000/api/product/view")
            .then(res => res.json())
            .then(
                (result) => {
                    setIsLoaded(true);
                    setProductos(result)
                },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
    }, [])


        const renderProducto = () => {

            return (

                <table className="table table-borderless">

                </table>

            );
        };

        return (
            <div className="auth-wrapper">




                <div className="card dash-inner ">
                    <div>
                        <div className="d-flex">
                            <a type="button" className="btn btn-success btn-sm ms-auto" href="/createprod">
                                Add new product
                            </a>
                        </div>
                        <div className=" table-responsive px-md-4 px-2 pt-3 justify-content-center ">
                            <table className="table table-borderless">

                                {renderProducto()}

                            </table>
                        </div>
                    </div>
                </div>
            </div>
        );
    };

export default Dashboard;
